import React from 'react';
import styled from 'styled-components';

const Card = ({ background, shadow }) => {
	const Card = styled.div`
		background: ${background};
		border-radius: 8px;
		box-shadow: 4px 4px 4px ${shadow};
		padding: 8px;
	`;

	return <React.Fragment />;
};

export default Card;
